import { createAsyncThunk , createSlice } from "@reduxjs/toolkit";
import {axios} from 'axios';

const addUser = createAsyncThunk('postUserData', async(userInformation) => {
    const data = await axios.post('http://localhost:5000/login',userInformation)
    return data;
})

const UserSlice = createSlice({
    name:'userData',
    initialState : {
        username: 'mehmetraif33',
        name:'Mehmet Raif',
        surname:'Ak√ßakaya',
        mail:'akcakayamehmetr@gmail.com',
        password:'Mm5@12345',
        profileImage:'data:image/jpeg;base64,',
        isHere: true,
        loading: false
    },
    reducers:{
        logout: (state , action) => {
            state = action.payload;
        },
        changeToImage: (state , action) => {
            state.profileImage = action.payload;
        }
    },
    extraReducers: (builder) => {
        builder.addCase(addUser.pending, (state, action) => {
            state.loading = true
        });
        builder.addCase(addUser.fulfilled, (state, action) => {
            state.loading = false
            state = action.payload
        });
        builder.addCase(addUser.rejected, (state, action) => {
            state.isHere = action.payload
        })
    }
})

export const { logout , changeToImage } = UserSlice.actions;
export default UserSlice.reducer;